import { Route, Routes } from 'react-router';
import Home from './pages/Home';

function App() {
  return (
    <div className="App bg-[#2F2F2F] text-white">
      <div className="contianer max-w-[1200px] mx-auto h-screen">
        <Routes>
          <Route exact path="/" element={<Home />} />
        </Routes>
      </div>
    </div>
  );
}

export default App;
